--  DDL for View COLLABO_LIST_VIEW
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "FINALEX"."COLLABO_LIST_VIEW" ("COLLABO_NO", "COLLABO_TITLE", "COLLABO_CONTENT", "COLLABO_CREATE_DATE", "COLLABO_UPDATE_DATE", "COLLABO_COUNT", "WRITER_DEPT_NAME", "WRITER_DEPT_CODE", "WRITER_JOB_NAME", "COLLABO_DEPT", "COLLABO_START_DATE", "COLLABO_END_DATE", "COLLABO_DELETE_YN", "COLLABO_STATUS", "COLLABO_STATUS_TITLE", "MEMBER_NAME", "MEMBER_NO", "MEMBER_EMAIL", "TASK_ACCEPTER_NAME", "TASK_ACCEPTER", "CMMT_COUNT") AS 
  SELECT COLLABO_NO, COLLABO_TITLE, COLLABO_CONTENT,COLLABO_CREATE_DATE, COLLABO_UPDATE_DATE, COLLABO_COUNT, 
(SELECT DEPT_NAME FROM DEPARTMENT DT WHERE DT.DEPT_CODE = 
    (SELECT DEPT_CODE FROM MEMBER M WHERE CB.MEMBER_NO = M.MEMBER_NO ))WRITER_DEPT_NAME, 
(SELECT DEPT_CODE FROM MEMBER M WHERE CB.MEMBER_NO = M.MEMBER_NO )WRITER_DEPT_CODE,
(SELECT JOB_NAME FROM JOB J WHERE J.JOB_CODE = 
    (SELECT M.JOB_CODE FROM MEMBER M WHERE CB.MEMBER_NO = M.MEMBER_NO ))WRITER_JOB_NAME,
COLLABO_DEPT,
COLLABO_START_DATE, COLLABO_END_DATE, COLLABO_DELETE_YN,COLLABO_STATUS,
CASE COLLABO_STATUS 
WHEN 1 THEN '요청중'
WHEN 2 THEN '요청수락'
WHEN 3 THEN '요청거절'
WHEN 4 THEN '처리완료'
END AS COLLABO_STATUS_TITLE, 
(SELECT MEMBER_NAME
FROM MEMBER M
WHERE M.MEMBER_NO = CB.MEMBER_NO)MEMBER_NAME, 
MEMBER_NO,
(SELECT MEMBER_EMAIL
FROM MEMBER M
WHERE M.MEMBER_NO = CB.MEMBER_NO)MEMBER_EMAIL,
(SELECT MEMBER_NAME
FROM MEMBER M
WHERE M.MEMBER_NO = CB.TASK_ACCEPTER)TASK_ACCEPTER_NAME,
TASK_ACCEPTER,
(SELECT COUNT(*) FROM COLLABO_COMMENT CM WHERE CM.COLLABO_NO = CB.COLLABO_NO AND CBOARD_CMMT_DELETE_YN = 'Y')CMMT_COUNT
FROM COLLABO_BOARD CB
;
