--------------------------------------------------------
--  DDL for View V_DOCLIST
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "FINALEX"."V_DOCLIST" ("DOCNO", "DOCTITLE", "DOCCONTENTS", "DELETEFLAG", "DOCSTATUS", "DOCSTEP", "INSERTDATE", "DEPTNM", "DTNO", "DRAFTER", "DRAFTERNAME", "DOCSIGNPATH", "DOCREMARK", "SSNO", "SSTEP", "SSRESULT", "SSCOMMENT", "RECEIVEDATE", "SIGNDATE", "USERPOS", "PAYER", "PAYERNAME", "DTITLE", "SIGN_NO", "SIGN_ORIGIN_NM", "SIGN_CHANGE_NM", "SIGN_PATH", "MEMBER_NO") AS 
  SELECT SD.DOCNO, SD.DOCTITLE,SD.DOCCONTENTS,SD.DELETEFLAG,SD.DOCSTATUS,SD.DOCSTEP AS DOCSTEP,SD.INSERTDATE,SD.DEPTNM,SD.DTNO,SD.MEMBER_NO AS DRAFTER,M1.MEMBER_NAME AS DRAFTERNAME,
SD.DOCSIGNPATH,SD.DOCREMARK,
SS.SSNO,SS.SSTEP,SS.SSRESULT,SS.SSCOMMENT,SS.RECEIVEDATE,SS.SIGNDATE,SS.USERPOS,SS.MEMBER_NO AS PAYER,M2.MEMBER_NAME PAYERNAME,
SDT.DTITLE, MS.SIGN_NO, MS.SIGN_ORIGIN_NM, MS.SIGN_CHANGE_NM, MS.SIGN_PATH, MS.MEMBER_NO
FROM SGN_DOC SD
INNER JOIN SGN_DOCTYPE SDT ON(SD.DTNO=SDT.DTNO)
INNER JOIN MEMBER M1 ON (SD.MEMBER_NO = M1.MEMBER_NO)
INNER JOIN SGN_SIGN SS ON (SD.DOCNO=SS.DOCNO)
LEFT JOIN MEMBER_SIGN_IMAGE MS ON (SS.MEMBER_NO=MS.MEMBER_NO)
INNER JOIN MEMBER M2 ON (SS.MEMBER_NO = M2.MEMBER_NO)
;
