  SELECT MEMBER_NO, MEMBER_EMAIL, MEMBER_PWD, MEMBER_NAME, ENROLLDATE, MEMBER_STATUS,
        PHONE_NUMBER, MEMBER_GRADE, DEPT_CODE, JOB_CODE, MEMBER_HOLIDAY, MEMBER_IDNO,
        GENDER, MEMBER_ADDR, EXTENSION_NUMBER, DEPT_NAME, JOB_NAME
