  CREATE OR REPLACE FORCE VIEW "FINALEX"."V_NOTICE" ("NOTICE_NO", "NOTICE_TITLE", "NOTICE_CONTENT", "NOTICE_CREATE_DATE", "NOTICE_UPDATE_DATE", "NOTICE_COUNT", "NOTICE_STATUS", "MEMBER_NO", "NOTICE_CODE", "MEMBER_NAME", "NOTICE_NAME") AS 
  SELECT N.NOTICE_NO, N.NOTICE_TITLE, N.NOTICE_CONTENT, N.NOTICE_CREATE_DATE, N.NOTICE_UPDATE_DATE,
    N.NOTICE_COUNT, N.NOTICE_STATUS, N.MEMBER_NO, N.NOTICE_CODE, M.MEMBER_NAME, C.NOTICE_NAME 
FROM NOTICE N
JOIN MEMBER M ON(N.MEMBER_NO = M.MEMBER_NO)
JOIN NOTICE_CATEGORY C ON(N.NOTICE_CODE = C.NOTICE_CODE)
WHERE N.NOTICE_STATUS = 'Y'
ORDER BY N.NOTICE_NO DESC
;
