--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "FINALEX"."V_PERSONALMSG_SELECT" ("MEMBER_NAME", "DEPT_NAME", "JOB_NAME", "DEPT_CODE", "MEMBER_NO") AS 
  SELECT MEMBER_NAME, DEPT_NAME, JOB_NAME, DEPT_CODE, MEMBER_NO
FROM MEMBER
JOIN DEPARTMENT USING(DEPT_CODE)
JOIN JOB USING(JOB_CODE)
;
--------------------------------------------------------
--  DDL for View V_SIGNLIST
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "FINALEX"."V_SIGNLIST" ("DOCNO", "DRAFTER", "DOCTITLE", "INSERTDATE", "DELETEFLAG", "DTNO", "DTITLE", "MEMBER_NO", "MEMBER_NAME", "DOCSTATUS", "SIGNDATE", "SSTEP") AS 
  SELECT SD.DOCNO, SD.MEMBER_NO DRAFTER, DOCTITLE, INSERTDATE, SD.DELETEFLAG, SD.DTNO, SDT.DTITLE, SS.MEMBER_NO,M2.MEMBER_NAME,SD.DOCSTATUS,SIGNDATE,SSTEP -- SS.MEMBER_NO(결재자 번호)
FROM SGN_DOC SD
 JOIN MEMBER M ON SD.MEMBER_NO=M.MEMBER_NO
INNER JOIN SGN_DOCTYPE SDT ON SDT.DTNO=SD.DTNO
LEFT JOIN SGN_SIGN SS ON SD.DOCNO=SS.DOCNO
LEFT JOIN MEMBER M2 ON SS.MEMBER_NO=M2.MEMBER_NO
ORDER BY DOCNO
;
